import React from "react";
import wordLib from "word-lib";

wordLib.exists("word")
function WordelLogic() {
    let word = "money";
    function CheckWord(val){
       if(val===word){
        console.log("true");
       }
    }
    return (
      <div>
      {CheckWord("money")}
      </div>
    );
  }

  export default WordelLogic;
